document.addEventListener("DOMContentLoaded", function() {
    // Create a new style element
    var fontStyle = document.createElement('style');
    fontStyle.innerHTML = `
        @font-face {
            font-family: 'Torus';
            src: url('https://lspectroniztar.github.io/osu-3D/Game%20Assets/fonts/torus/Torus-Regular.otf') format('opentype');
        }

        .loading-screen-text {
            font-family: 'Torus', sans-serif !important;
            font-size: 24px; /* Change this to your desired font size */
        }
    `;

    // Append the new style to the head of the document
    document.head.appendChild(fontStyle);

    // Apply the font style to the loading screen text
    var loadingText = document.querySelector('.loading-screen-text');
    if (loadingText) {
        loadingText.style.fontFamily = 'Torus, sans-serif';
        loadingText.style.fontSize = '10px'; // Change this to your desired font size
    }
});
